# drugbank 
def plot_drugbank():
    pwd = 'drugbank/'
    files = ['train.txt','valid.txt','test.txt']
    cnt = {}
    for i in range(86):
        cnt[i]=0
    for fi in files:
        f = open(pwd+fi,'r')
        for line in f:
            r = int(line.strip().split()[2])
            cnt[r]+=1

    sorted_cnt = sorted(cnt.items(), key = lambda kv:(kv[1], kv[0]))   
    label = [pair[0] for pair in sorted_cnt]
    value = [pair[1] for pair in sorted_cnt]
    label.reverse()
    value.reverse()

    x_major_locator=MultipleLocator(5)
    
    # frequency
    fig1 = plt.figure(figsize=(20,4))
    rect1=plt.bar(np.arange(len(value))+1, [num for num in value])
    plt.xlim([0,90])    
    plt.gca().xaxis.set_major_locator(x_major_locator)
    plt.ylabel('Number of fact triplets')
    plt.title('Relations sorted by decreasing number of fact triplets')
    plt.tight_layout()
    plt.savefig('frequency_drugbank.png',dpi=300)
    plt.show()

    # frequency in log scale
    fig2 = plt.figure(figsize=(20,4))
    rect1=plt.bar(np.arange(len(value))+1, [num for num in value])
    plt.xlim([0,90])    
    plt.gca().xaxis.set_major_locator(x_major_locator) 
    plt.yscale('log')
    plt.ylabel('Number of fact triplets (log scale)')
    plt.title('Relations sorted by decreasing number of fact triplets')
    plt.tight_layout()
    plt.savefig('frequency_drugbank_log.png',dpi=300)
    plt.show()

    #minus_DB
    minus = [(DB_ours[i] - DB_sumgnn[i])*100 for i in range(len(DB_sumgnn)) ]
    sorted_minus = [minus[i] for i in label]
    fig3 = plt.figure(figsize=(20,4))
    minu = np.array(sorted_minus)
    sample = np.arange(len(sorted_minus))+1
    plt.bar(sample[minu < 0], minu[minu < 0], color='tomato')
    plt.bar(sample[minu > 0], minu[minu > 0], color='cornflowerblue')
    plt.axhline(0, color='grey', lw=0.5)
    plt.xlim([0,90])
    plt.gca().xaxis.set_major_locator(x_major_locator)
    plt.ylabel('F1 improvement (\%)')
    plt.title('Relations sorted by decreasing number of fact triplets')
    plt.tight_layout()
    plt.savefig('minus_drugbank.png',dpi=300)
    plt.show()


def plot_twosides():
    f =  open("twosides_frequency.csv")
    cnt = 0
    names = []
    frequencys = []
    for line in f:
        cnt+=1
        if cnt>600 and cnt<=800:
            msg = line.strip().split(',')
            names.append(int(msg[0]))
            frequencys.append(int(msg[1]))

    x_major_locator=MultipleLocator(20)

    # ori TWOSIDES frequency
    fig = plt.figure(figsize=(20,4))
    rect1=plt.bar(np.arange(len(frequencys))+1, [num for num in frequencys])
    ax=plt.gca()
    ax.xaxis.set_major_locator(x_major_locator)
    plt.ylabel('Number of fact triplets')
    plt.title('Relations sorted by decreasing number of fact triplets')
    plt.xlim([0,201])  
    plt.tight_layout()
    plt.savefig('frequency_twosides.png',dpi=300)
    plt.show()

    #minus_twosides
    minus = [(TS_ours['auc_all'][i] - TS_sumgnn['auc_all'][i])*100 for i in range(len(TS_sumgnn['auc_all'])) ]
    minu = np.array(minus)
    fig = plt.figure(figsize=(20,4))
    sample = np.arange(len(minus))+1
    plt.bar(sample[minu < 0], minu[minu < 0], color='tomato')
    plt.bar(sample[minu > 0], minu[minu > 0], color='cornflowerblue')
    plt.axhline(0, color='grey', lw=0.5)
    ax=plt.gca()
    ax.xaxis.set_major_locator(x_major_locator)
    plt.ylabel('AUROC improvement (\%)')
    plt.title('Relations sorted by decreasing number of fact triplets')
    plt.xlim([0,201])
    plt.tight_layout()
    plt.savefig('minus_twosides.png',dpi=300)
    plt.show()


